import React from 'react';
import {
  Box,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  useTheme,
  colors
} from '@material-ui/core';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import ArrowRightIcon from '@material-ui/icons/ArrowRight';
import { FhirClientContext } from '../../FhirClientContext';
import FhirClientProvider from '../FhirClientProvider.js';

function Headerbanner(patient) {

  return (
  <FhirClientProvider>


    <div className={classes.root}>
    hi
    </div>

  </FhirClientProvider>
  );
}

export default class Saless extends React.Component {
    static contextType = FhirClientContext;
    constructor(props) {
        super(props);
        this.state = {
            loading: false,
            patient: null,
            error: null
        };
    }
    // this loader is used for
    render() {
        const { error, loading, patient } = this.state;

        if (loading) {
            return null;
        }
        if (error) {
            return error.message;
        }
        return <Headerbanner {...patient} />;
    }
}
